INSERT INTO `EvaluationFormStep` VALUES (1,'draft',1,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-18 01:33:55','3673a855-5f81-40c5-a61b-8a2198620107','2024-01-15 17:18:22','Stärken','Die Fragen dienen dazu, die persönlichen Stärken einer Person aufgrund ihrer eigenen Selbsteinschätzung zu ermitteln und bieten Einblicke in ihre Werthaltung und Vorlieben. Ein Persönlichkeitstest wird zusätzlich verwendet, um die Stärken genauer zu analysieren und ein umfassenderes Bild der individuellen Persönlichkeit zu zeichnen.'),(2,'draft',2,NULL,NULL,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-28 17:38:36','Persönliche Werte','Unsere Werte sind tief verwurzelte Überzeugungen und Prinzipien, die das Verhalten und die Entscheidungen einer Person leiten. Es ist wichtig, sie zu kennen, da sie als innerer Kompass dienen und helfen,'),(3,'draft',3,NULL,NULL,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-28 17:38:42','Der ideale Arbeitsrahmen','Ein Arbeitsrahmen, der den eigenen Bedürfnissen entspricht, fördert die persönliche Zufriedenheit und das Wohlbefinden am Arbeitsplatz, da er eine angenehme und produktive Arbeitsumgebung schafft. Bei der Berufswahl ist es wichtig, diesen Rahmen zu berücksichtigen, um sicherzustellen, dass der gewählte Beruf und die Arbeitsbedingungen den individuellen Anforderungen und Vorlieben gerecht werden.'),(4,'draft',4,NULL,NULL,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-28 17:38:46','Finanzierungsmöglichkeiten','Die Fragen zur Prüfung des Anspruchs auf einen Bildungsgutschein dienen dazu, die individuellen Bildungsbedürfnisse und beruflichen Ziele einer Person zu ermitteln. Dies ermöglicht es, festzustellen, ob sie berechtigt ist, staatliche Unterstützung für die Finanzierung ihrer Weiterbildung oder Umschulung zu erhalten.'),(5,'published',5,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-25 04:03:18','3673a855-5f81-40c5-a61b-8a2198620107','2024-01-15 18:04:50','<p>Personality</p>','<p>Our values are deeply held <strong>beliefs </strong>and principles that guide a person\'s behavior and decisions. It is important to know them because they serve as an inner compass and help make authentic decisions that are in line with one\'s beliefs and goals.</p>');
