 und ein umfassenderes Bild der individuellen Persönlichkeit zu zeichnen.\", \"date_created\": \"2023-11-18T01:33:55.000Z\", \"date_updated\": \"2023-11-28T17:38:32.000Z\", \"user_created\": \"3673a855-5f81-40c5-a61b-8a2198620107\", \"user_updated\": \"3673a855-5f81-40c5-a61b-8a2198620107\"}','{\"status\": \"draft\", \"date_updated\": \"2023-11-28T17:38:32.010Z\", \"user_updated\": \"3673a855-5f81-40c5-a61b-8a2198620107\"}',NULL,NULL),(1607,2262,'EvaluationFormStep','2','{\"id\": 2, \"sort\": 2, \"title\": \"Persönliche Werte\", \"status\": \"draft\", \"description\": \"Unsere Werte sind tief verwurzelte Überzeugungen und Prinzipien, die das Verhalten und die Entscheidungen einer Person leiten. Es ist wichtig, sie zu kennen, da sie als innerer Kompass dienen und helfen,\", \"date_created\": null, \"date_updated\": \"2023-11-28T17:38:36.000Z\", \"user_created\": null, \"user_updated\": \"3673a855-5f81-40c5-a61b-8a2198620107\"}','{\"status\": \"draft\", \"date_updated\": \"2023-11-28T17:38:36.369Z\", \"user_updated\": \"3673a855-5f81-40c5-a61b-8a2198620107\"}',NULL,NULL),(1608,2263,'EvaluationFormStep','3','{\"id\": 3, \"sort\": 3, \"title\": \"Der ideale Arbeitsrahmen\", \"status\": \"draft\", \"description\": \"Ein Arbeitsrahmen, der den eigenen Bedürfnissen entspricht, fördert die persönliche Zufriedenheit und das Wohlbefinden am Arbeitsplatz, da er eine angenehme und produktive Arbeitsumgebung schafft. Bei der Berufswahl ist es wichtig, diesen Rahmen zu berücksichtigen, um sicherzustellen, dass der gewählte Beruf und die Arbeitsbedingungen den individuellen Anforderungen und Vorlieben gerecht werden.\", \"date_created\": null, \"date_updated\": \"2023-11-28T17:38:42.000Z\", \"user_created\": null, \"user_updated\": \"3673a855-5f81-40c5-a61b-8a2198620107\"}','{\"status\": \"draft\", \"date_updated\": \"2023-11-28T17:38:41.548Z\", \"user_updated\": \"3673a855-5f81-40c5-a61b-8a2198620107\"}',NULL,NULL),(1609,2264,'EvaluationFormStep','4','{\"id\": 4, \"sort\": 4, \"t